import axios from 'axios';

const URL = "http://localhost:8080/musely-takehome/rest/users/all";

class UserService {
    getUsers(){
        return axios.get(URL);
    }

    createUsers(user){
        return axios.post(`${URL}/all`, user);
    }
}

export default new UserService()
